package valid_palindrome_ii;

/**
 * @author fandeshan
 * @description 680. 验证回文串 II
 *
 * 给你一个字符串 s，最多 可以从中删除一个字符。
 *
 * 请你判断 s 是否能成为回文字符串：如果能，返回 true ；否则，返回 false 。
 *
 *
 *
 * 示例 1：
 *
 * 输入：s = "aba"
 * 输出：true
 * 示例 2：
 *
 * 输入：s = "abca"
 * 输出：true
 * 解释：你可以删除字符 'c' 。
 * 示例 3：
 *
 * 输入：s = "abc"
 * 输出：false
 *
 *
 * 提示：
 *
 * 1 <= s.length <= 105
 * s 由小写英文字母组成
 *
 * @date 2022/10/28
 */
public class Solution {
    public boolean validPalindrome(String s) {
        int start = 0;
        int end = s.length() - 1;
        while (start < end){
            if (s.charAt(start) != s.charAt(end)){
                return checkPalindrone(s,start,end -1) || checkPalindrone(s,start + 1, end);
            }
            start ++;
            end --;
        }
        return true;
        //return checkPalindrone(s,0,s.length()-1,false);
    }
    private boolean checkPalindrone(String s,int start,int end,boolean removed){
        if (end == start + 1 || start ==  end ){
            return true;
        }
        if (s.charAt(start) != s.charAt(end)){
            if (removed){
                return false;
            }
            removed = true;
            return checkPalindrone(s,start + 1,end,removed)||checkPalindrone(s,start,end -1,removed);
        }
        return checkPalindrone(s,start+1,end-1,removed);
    }
    private boolean checkPalindrone(String s,int start,int end){
        while (start < end){
            if (s.charAt(start) != s.charAt(end)){
                return false;
            }
            start ++;
            end --;
        }
        return true;
    }

    public static void main(String[] args) {
        System.out.println(new Solution().validPalindrome("deeee"));
        System.out.println(new Solution().validPalindrome(""));
    }
}
